let success = 0;
let failed = 0;

function shuffle(array) {
  array.sort(() => Math.random() - 0.5);
  return array;
}

(async () => {
  const crawlerOptions = config.get("crawlerOptions.puppeteerCrawler");
  const proxies = shuffle(PROXIES);
  const crawler = new Crawler(Crawler.PUPPETEER_CRAWLER, {
    setUpProxies: { proxies, swapProxies: true },
    crawlerOptions,
  });

  crawler.start({
    failedRequest: async ({ log, request }) => {
      log.error(request.errorMessages[0]);
      log.info("Failed:: " + ++failed);
      fs.appendFileSync("results/failed_domains.txt", `'${request.url}',\n`, {
        encoding: "utf-8",
      });
    },
    requestHandler: async ({
      log,
      infiniteScroll,
      page,
      parseWithCheerio,
      request,
    }) => {
      await sleep(15_000);
      const $ = await parseWithCheerio();
      const rank = $(
        "#overview > div > div > div > div.wa-overview__column.wa-overview__column--ranking > div > div.wa-rank-list__item.wa-rank-list__item--country > p.wa-rank-list__value"
      ).text();

      fs.appendFileSync(
        "results/results.txt",
        `'${request.url}','${
          rank.includes("#") ? rank.replace("#", "") : rank === "" ? "-1" : "0"
        }'\n`,
        {
          encoding: "utf-8",
        }
      );
      log.info("Success:: " + ++success);
    },
  });

  setInterval(() => {
    const urls = URLS.splice(0, 15);
    console.log("Checkkk:: " + URLS.length);
    if (urls.length) {
      crawler.addRequests(
        urls.map((url) =>
          Crawler.createRequest({
            url: `https://www.similarweb.com/website/${url}/#overview`,
          })
        )
      );
    }
  }, 30_000);
})();
